import React from 'react';
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <div class="flex space-x-10 justify-center">
      <button class="bg-blue-200 px-3"><Link to="/" >New Proposal</Link></button>
      <button class="bg-blue-200 px-3"><Link to="/proposals">All Proposals</Link></button>
      <button class="bg-blue-200 px-3"><Link to="/edit">Edit Proposal</Link></button>
    </div>
  );
}

export default Navbar;
